import React from 'react';
import ReactDOM from  'react-dom';
const name="Prashant";
const lname="Wadekar";
ReactDOM.render(
  <>
<h1>My name is {name}</h1>
<p>My Roll Number is {Math.random()}</p>
<h1>My Full Name is {name}{lname}</h1>
<h1>My Full Name is {name +" "+ lname}</h1>
<h1>My First name is {name} last name is {lname}</h1>
<h1>My Full Name l</h1>
  </>,
  document.getElementById("root")
);
